import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/esm/Container';

function headers() {
  return (
    <Container fluid style={{height:'1rem', backgroundColor:'dark' }}>
        <hr style={{ backgroundColor:'white', width:'90%',height:'2px',border:'none'}}/>
        <hr style={{ backgroundColor:'white', width:'50%',height:'2px',border:'none'}}/>
        <hr style={{ backgroundColor:'white', width:'20%',height:'2px',border:'none'}}/>
    </Container>
    
  );
}

export default headers;
